The plugin is a "free fantasy on the theme" of a similar Photoshop tool.

WASM VERSION:
Radius - blur radius;
Threshold - determines the threshold for selecting "edges", areas that will not be blurred in the end;
Blur type - selection of different blur algorithms;
Smooth - in fact, the width of the softening area of the blur effect around the "edges";
Mode - the choice between the normal mode, the mode of displaying only the "edges" mask, or the mode of applying this mask to the final result.

SCRIPTS VERSION:
Works completely on the functionality of Photopea. Blur settings here are classic. Fuzziness is similar to the Color Range setting, it is needed to select a selection mask that preserves the "edges".

